import React from "react";
import Pagination from "./Pagination";
import Search from "./Search";
import Stories from "./Stories";

const App = () => {
  return (
    <>
      <h1>Welcome to my Tech News Websitee</h1>
      <Search />
      <Pagination />
      <Stories />
    </>
  );
};

export default App;
